import Vue from "vue";
import App from "./App.vue";
import router from "@/router";

Vue.use(PrismicVue, {
  endpoint: window.prismic.endpoint,
  linkResolver,
  htmlSerializer
})

Vue.config.productionTip = false;
new Vue({
  router,
  render: (h) => h(App)
}).$mount("#app");
